import React,{Component,useState} from 'react';
import 'tachyons';
import {Gal} from './galleryimg';

function Gallery() {
   const[gal,setgal]=useState(Gal);
    return (

               <div className="flex flex-wrap">
               {
                  Gal.map((data)=>(
                  <div data-aos={data.dataaos} data-aos-duration={data.dataaosduration}>
                      <img src={data.image} height={data.height} width={data.width}/>
                    </div>
                  ))
                }
               </div>


      );
}

export default Gallery;

